//TLE 108 / 121 个通过测试用例
var threeEqualParts2 = function(arr) {

    let check = (arr, i, j) => {
        let s1 = 0, s2 = i + 1, s3 = j;
        while(arr[s1] == 0 && s1 <= i - 1) {
            s1++;
        }
        while(arr[s2] == 0 && s2 <= j - 2) {
            s2++;
        }
        while(arr[s3] == 0 && s3 <= arr.length - 2) {
            s3++;
        }
        while(s1 <= i && s2 <= j - 1 && s3 <= arr.length - 1) {
            if(arr[s1] != arr[s2] || arr[s2] != arr[s3]) {
                return false;
            }
            s1++;
            s2++;
            s3++;
        }
        if(s1 != i + 1 || s2 != j || s3 != arr.length) {
            return false;
        }
        return true;
    }

    let n = arr.length;
    
    //check(arr, 0, 2);
    for(let i = 0; i < n; i++) {        
        for(let k = i + 2; k < n; k++) {
            if(check(arr, i, k)) {
                return [i,k];
            }
        }    
    }
    return [-1,-1];
};

//TLE 109 / 121 个通过测试用例
var threeEqualParts3 = function(arr) {
    let check = (arr, i, j) => {
        //console.log(`check ${i} ${j}`);
        let s1 = 0, s2 = i + 1, s3 = j;
        while(arr[s1] == 0 && s1 <= i - 1) {
            s1++;
        }
        while(arr[s2] == 0 && s2 <= j - 2) {
            s2++;
        }
        while(arr[s3] == 0 && s3 <= arr.length - 2) {
            s3++;
        }
        while(s1 <= i && s2 <= j - 1 && s3 <= arr.length - 1) {
            if(arr[s1] != arr[s2] || arr[s2] != arr[s3]) {
                return false;
            }
            s1++;
            s2++;
            s3++;
        }
        if(s1 != i + 1 || s2 != j || s3 != arr.length) {
            return false;
        }
        return true;
    }

    let n = arr.length;
    let count = 0;
    for(let i = 0; i < n; i++) {
        if(arr[i] == 1) {
            count++;
        }
    }
    if(count % 3 != 0) {
        return [-1,-1];
    }
    let dstCount = count / 3;
    count = 0;
    let begin = 0;
    for(let i = 0; i < n; i++) {
        if(arr[i] == 1) {
            count++;
        }
        if(count == dstCount) {
            begin = i;
            break;
        }
    }
    
    //check(arr, 0, 2);
    for(let i = begin; i < n; i++) {        
        for(let k = i + 2; k < n; k++) {
            if(check(arr, i, k)) {
                return [i,k];
            }
        }    
    }
    return [-1,-1];
}

var threeEqualParts = function(arr) {

    //根据1进行三等份
    let n = arr.length;
    let count = 0;
    for(let i = 0; i < n; i++) {
        if(arr[i] == 1) {
            count++;
        }
    }
    if(count % 3 != 0) {
        return [-1,-1];
    }
    if(count == 0) {
        return [0,2];
    }
    let dstCount = count / 3;
    count = 0;
    let s1 = -1, s2 = -1, s3 = -1, s4 = -1, s5 = -1, s6 = -1;
    for(let i = 0; i < n; i++) {
        if(arr[i] == 1) {
            if(s1 == -1) {
                s1 = i;
            }
            if(s2 != -1 && s3 == -1) {
                s3 = i;
            }
            if(s4 != -1 && s5 == -1) {
                s5 = i;
            }
            count++;
        }
        if(count == dstCount && s2 == -1) {
            s2 = i;            
        } else if(count == 2 * dstCount && s4 == -1) {
            s4 = i;
        } else if(count == 3 * dstCount && s6 == -1) {
            s6 = i;
            break;
        }
    }
    //s1-s2 s3-s4 s5-s6相等
    for(let i = 0; i <= s2 - s1; i++) {
        if(arr[s1 + i] != arr[s3 + i] || arr[s1 + i] != arr[s5 + i]) {
            return [-1,-1];
        }
    }
    //补充s6末尾的零
    let dst = n - s6 - 1;
    if(s5 - s4 - 1 < dst || s3 - s2 - 1 < dst) {
        return [-1,-1];
    }
    return [s2 + dst, s4 + dst + 1];
}

